import styled from 'styled-components'

export const SideBarStyle = styled.div`

    margin: 0;
    padding: 0;

ul{
    padding: 0;
    margin: 0;
}

li{
    list-style: none;
}

.container{
    background-color: #1E212A;
    width: 100px;
    height: 190px;

}


`
